import React from "react";
import RadioButtons from "./Radiobuttons";

const ART_CHOICES = [
  {
    category: "audio",
    choices: ["acoustic", "cinematic", "rock"]
  },
  {
    category: "images",
    choices: ["butterfly", "flower", "painting"]
  },
  {
    category: "text",
    choices: ["lyric", "poem", "quote"]
  }
];

function App() {
  return (
    <div className="App">
      {ART_CHOICES}
    </div>
  );
}

export default App;
